import './App.css';
import TypeWriter from 'typewriter-effect'



function Heading() {

  return (
      <TypeWriter className='tracking-wider font-mono text-white text-9xl text-center'
        options={{ 
          loop: true,
          delay: 100,

        }}
        onInit={(typewriter) => {
          typewriter.typeString("Hey I'm Faizan").pauseFor(2000).start().deleteAll(100).pauseFor(2000)

        }}
      />
  );
}

export default Heading;
